public static String unescapeJava(String str) throws Exception {
	if (str == null) {
		return null;
	}
	int len = str.length();
	if (len == 0) {
		return str;
	}
	int i = 0;
	int start = 0;
	char[] buffer = new char[len];
	char ch = 0;
	while (i < len) {
		ch = str.charAt(i);
		if (ch == '\\') {
			if (++i >= len) {
				break;
			}
			ch = str.charAt(i);
			if (ch == 'u') {
				int value = 0;
				if (++i >= len) {
					break;
				}
				ch = str.charAt(i);
				for (int j = 0; j < 4; ++j) {
					if (++i >= len) {
						break;
					}
					ch = str.charAt(i);
					int digit = Character.digit(ch, 16);
					if (digit == -1) {
						break;
					}
					value = (value << 4) + digit;
				}
				buffer[start++] = (char) value;
			} else {
				switch (ch) {
				case 'b':
					ch = '\b';
					break;
				case 't':
					ch = '\t';
					break;
				case 'n':
					ch = '\n';
					break;
				case 'f':
					ch = '\f';
					break;
				case 'r':
					ch = '\r';
					break;
				case 'u':
					ch = 'u';
					break;
				case '"':
					ch = '"';
					break;
				case '\'':
					ch = '\'';
					break;
				case '\\':
					ch = '\\';
					break;
				default:
					break;
				}
				if (ch!= 0) {
					buffer[start++] = ch;
				}
			}
		} else {
			buffer[start++] = ch;
		}
		++i;
	}
	return new String(buffer, 0, start);
}

