public static LinkedBuffer writeUTF8(final CharSequence str,final WriteSession session,final LinkedBuffer lb){
int len=str.length();
int i=0;
while (i<len) {
int c=str.charAt(i);
if (c<0x80) {
lb.put(c);
}
 else if (c<0x800) {
lb.put(0xc0|(c>>6));
lb.put(0x80|(c&0x3f));
}
 else if (c<0x10000) {
lb.put(0xe0|(c>>12));
lb.put(0x80|((c>>6)&0x3f));
lb.put(0x80|(c&0x3f));
}
 else if (c<0x110000) {
lb.put(0xf0|(c>>18));
lb.put(0x80|((c>>12)&0x3f));
lb.put(0x80|((c>>6)&0x3f));
lb.put(0x80|(c&0x3f));
}
i++;
}
return lb;
}

